import 'dart:developer';

import 'package:dart_twitter_api/api/tweets/data/collection/entrie_object_collections.dart';
import 'package:dart_twitter_api/api/tweets/data/collection/collection_object_collections.dart';
import 'package:dart_twitter_api/twitter_api.dart';
import 'package:http/http.dart';
import 'package:mockito/mockito.dart';
import 'package:test/test.dart';
import 'mock_client.dart';

void main() async {
  test('`collection list` collection object from response', () async {
    final mockClient = MockClient();

    when(mockClient.get(Uri.https('api.twitter.com',
            '1.1/collections/list.json', {'screen_name': 'TweetHKApp'})))
        .thenAnswer((_) async => Response(_collectionListResponse, 200));

    final collectionService = CollectionService(client: mockClient);

    final collections =
        await collectionService.collectionList(screenName: 'TweetHKApp');

    expect(collections, isA<CollectionObjectCollections>());
  });

  test('`collection entries` collection object from response', () async {
    final mockClient = MockClient();

    when(mockClient.get(Uri.https(
            'api.twitter.com',
            '1.1/collections/entries.json',
            {'id': '1234', 'tweet_mode': 'extended'})))
        .thenAnswer((_) async => Response(_collectionEntriesResponse, 200));

    final collectionService = CollectionService(client: mockClient);

    final entries = await collectionService.entries(id: '1234');

    expect(entries, isA<EntrieObjectCollections>());
  });
}

